"use strict";(self.webpackChunk=self.webpackChunk||[]).push([[9210],{9210:e=>{e.exports=JSON.parse('{"en":{"main_title":"Edouard Manet","name":"Edouard Manet","birthday_year":"1832","dead_year":"1883","description":"French painter who broke new ground by defying traditional techniques of representation and by choosing subjects from the events and circumstances of his own time. His Le Déjeuner sur l’herbe (Luncheon on the Grass), exhibited in 1863 at the Salon des Refusés, aroused the hostility of critics and the enthusiasm of the young painters who later formed the nucleus of the Impressionist group."},"ua":{"main_title":"Едуард Мане","name":"Едуард Мане","birthday_year":"1832","dead_year":"1883","description":"Французький художник, який відкрив новий шлях, кидаючи виклик традиційним прийомам зображення та вибираючи сюжети з подій і обставин свого часу. Його Le Déjeuner sur l’herbe (Обід на траві), виставлений у 1863 році в Salon des Refusés, викликав ворожість критиків і ентузіазм у молодих художників, які згодом склали ядро групи імпресіоністів."},"es":{"main_title":"Eduardo Manet","name":"Eduardo Manet","birthday_year":"1832","dead_year":"1883","description":"Pintor francés que abrió nuevos caminos desafiando las técnicas tradicionales de representación y eligiendo temas de los eventos y circunstancias de su propio tiempo. Su Le Déjeuner sur l\'herbe (Almuerzo sobre la hierba), exhibido en 1863 en el Salon des Refusés, despertó la hostilidad de la crítica y el entusiasmo de los jóvenes pintores que más tarde formarían el núcleo del grupo impresionista."}}')}}]);